import React, { useState } from 'react';
import { PieChart, Pie, Cell, ResponsiveContainer, Tooltip } from 'recharts';
import { BarChart3, DollarSign, TrendingUp } from 'lucide-react';

const AnalyticsDashboard = () => {
  // Sample data - replace with your actual data
  const [data] = useState([
    { name: 'transportation', value: 99, color: '#3498db' },
    { name: 'food', value: 0.4, color: '#e74c3c' },
    { name: 'entertainment', value: 0.3, color: '#2ecc71' },
    { name: 'testing', value: 0.2, color: '#f1c40f' },
    { name: 'income', value: 0.1, color: '#9b59b6' }
  ]);

  const totalExpenses = 129723.00;
  const totalIncome = 10005963.00;
  const mostExpensiveCategory = {
    name: 'food',
    amount: 123648.00
  };

  // Custom tooltip component
  const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
      return (
        <div className="bg-white p-4 rounded-lg shadow-lg border border-gray-200">
          <p className="text-sm text-gray-600">
            {`${payload[0].name}: ${payload[0].value}%`}
          </p>
        </div>
      );
    }
    return null;
  };

  return (
    <div className="p-5 max-w-7xl mx-auto font-sans">
      <div className="flex flex-col lg:flex-row gap-5">
        {/* Main Chart Section */}
        <div className="flex-grow bg-white rounded-lg shadow-md p-6">
          <div className="flex items-center gap-2 mb-6">
            <BarChart3 className="w-6 h-6 text-purple-800" />
            <h2 className="text-xl font-semibold text-gray-800">Spending by Category</h2>
          </div>
          
          <div className="h-[500px] w-full">
            <ResponsiveContainer width="100%" height="100%">
              <PieChart>
                <Pie
                  data={data}
                  cx="50%"
                  cy="50%"
                  labelLine={true}
                  label={({ name, value }) => `${name} ${value}%`}
                  outerRadius={200}
                  fill="#8884d8"
                  dataKey="value"
                >
                  {data.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={entry.color} />
                  ))}
                </Pie>
                <Tooltip content={<CustomTooltip />} />
              </PieChart>
            </ResponsiveContainer>
          </div>
        </div>

        {/* Stats Cards */}
        <div className="lg:w-80 space-y-5">
          {/* Total Expenses Card */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-medium text-gray-800 mb-2">Total Expenses</h3>
            <p className="text-2xl font-bold text-red-500">
              ${totalExpenses.toLocaleString('en-US', { minimumFractionDigits: 2 })}
            </p>
          </div>

          {/* Total Income Card */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-medium text-gray-800 mb-2">Total Income</h3>
            <p className="text-2xl font-bold text-green-500">
              ${totalIncome.toLocaleString('en-US', { minimumFractionDigits: 2 })}
            </p>
          </div>

          {/* Most Expensive Category Card */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-medium text-gray-800 mb-2">Most Expensive Category</h3>
            <p className="text-lg text-purple-800 mb-2">{mostExpensiveCategory.name}</p>
            <p className="text-2xl font-bold text-red-500">
              ${mostExpensiveCategory.amount.toLocaleString('en-US', { minimumFractionDigits: 2 })}
            </p>
          </div>
        </div>
      </div>

      {/* Pagination */}
      <div className="mt-8 flex justify-center">
        <div className="flex gap-2">
          <button className="px-4 py-2 rounded bg-gray-100 hover:bg-gray-200 transition-colors">
            Previous
          </button>
          <button className="px-4 py-2 rounded bg-purple-800 text-white">
            1
          </button>
          <button className="px-4 py-2 rounded bg-gray-100 hover:bg-gray-200 transition-colors">
            2
          </button>
          <button className="px-4 py-2 rounded bg-gray-100 hover:bg-gray-200 transition-colors">
            Next
          </button>
        </div>
      </div>
    </div>
  );
};

export default AnalyticsDashboard;
